import React , {Component} from "react";
import '../style.css';
import '../style1.css';
import Cities from '../cities.json'

class Ul extends Component{ 
    //البناء
constructor(){
super()
this.state = {
     pageNamer: [] ,
    Citieslength: 20

    }
console.log(Cities.length)
}







 //الكتابه

render(){
    for (var a = 1 ; a <= Citieslength /  3  ; a++ ){
       this.state.pageNamer.push(<li id="pagintion-li" key={a}>{a}</li>)

    }
   
return(
        <div>
        <ul id="pagintion-ul">
            {this.state.pageNamer}
        </ul>
        </div>
    )}
}
export default Ul;
